import React, { Component } from 'react'

class App extends Component {

  async postData(){

    try{
      var settings = {
        "url": "http://localhost:5000/simulacao",
        "method": "POST",
        "timeout": 0,
        "headers": {
          "Content-Type": "application/json"
        },
        "data": JSON.stringify({"nome":"pablo","email":"pablo.toldo3@outlook.com","telefone":"4545454545","senha_acesso":"080200","quantidade":"8000","tempo_investimento":"12"}),
      };

      $.ajax(settings).done(function (response) {
        console.log(response);
      });
    }catch(e){
      console.log(e)
    }

  }

  render(){
    return (
      <div className="App">
        <button onClick={ () => this.postData() }>send POST request</button>
      </div>
    );
}
}

export default App;
